YUI.add("queue-promote",function(e,i){e.mix(e.Queue.prototype,{indexOf:function(i){return e.Array.indexOf(this._q,i)},promote:function(i){i=this.indexOf(i);-1<i&&this._q.unshift(this._q.splice(i,1)[0])},remove:function(i){i=this.indexOf(i);-1<i&&this._q.splice(i,1)}})},"@VERSION@",{requires:["yui-base"]});